Es la primera vez, después de doce años de publicaciones, que presento algo en mi ciudad. Es extraño aunque, con una historia así, también es inevitable. El Fuego Sagrado se desarrolla en Badalona, como cualquier otro enclave de cualquier novela. Pero esta trilogía solo puede contarse aquí. Porque solo en Badalona se tiene el valor y la pasión de quemar demonios. 

Presentarlo en las Termas, con toda su mística, su historia y su misterio va a ser maravilloso. 

¡Nos vemos! ❤️‍🔥 

